    return (
        <>
            <div className="hc-container">
                <div className="hc-head">
                    <h4 className="hc1 hc1-s1">#BlackLivesMatter</h4>
                    <div className="form-group hc1 hc1-s2">
                        <button type="submit" className="btn btn-primary hcbtng">Generate</button>
                    </div>
                </div>
                {/* ----------------Body of Hashdetail */}
                

                <PieChart
                    data={[
                        { title: 'One', value: 10, color: '#E38627' },
                        { title: 'Two', value: 1.5, color: '#C13C37' },
                        { title: 'Three', value: 2, color: '#6A2135' },
                    ]}
                />;

                <div>

                </div>

            </div>
        </>
    );
}


